import * as React from 'react'
import { SvgIcon, Image } from './styles'
export const IconPets = (props) => {
  return (
    <SvgIcon width={512} height={512} {...props}>
      <Image
        data-name='Capa 1'
        x={0}
        y={0}
        width={110}
        height={80}
        xlinkHref='data:img/png;base64,'
      />
    </SvgIcon>
  )
}
